    return(
         //you return more than one element, you have wrap in parent element such as div tag (first option). 
         <div>
             <Header/> //referencing the external js file
             <h1>My React App H1</h1>
             <h2>My React App H2</h2>
        </div>

    )
}

ReactDOM.render(<App/>,document.getElementById('root'));
